import React from 'react';
import { Link, Routes, Route } from 'react-router-dom';
import Dashboard from './dashboard'; // Example subpage
import InvoiceList from './invoice_list'; // Example subpage
import Reminders from './reminders'; // Example subpage
import '../styles/homepage.css';

const HomePage = () => {
  return (
    <div className="homepage">
      {/* Sidebar */}
      <aside className="sidebar">
        <nav>
          <ul>
            <li><Link to="/homepage/dashboard">Dashboard</Link></li>
            <li><Link to="/homepage/invoices">Invoices</Link></li>
            <li><Link to="/homepage/reminders">Reminders</Link></li>
            {/* Add more links as needed */}
          </ul>
        </nav>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        <Routes>
          <Route path="dashboard" element={<Dashboard />} />
          <Route path="invoices" element={<InvoiceList />} />
          <Route path="reminders" element={<Reminders />} />
        </Routes>
      </main>
    </div>
  );
};

export default HomePage;
